import React from 'react';
import { members } from './../../config/config';
import { StyledHeader } from './styles';

const Header = () => {

    return (<>
        {members.map(member => {
            return <StyledHeader color={member.hexCode}>
                {member.name}
            </StyledHeader>
        })}
    </>);
}

export default Header;
